import React from "react";
import Site from "./Site";

function AllSites() {
  return (
    <Router>
        <div>THIS IS THE SITES PAGE</div>
        <nav>
            <Link to="/site/:name"> Site </Link>
        </nav>
    </Router>
  );
}

export default AllSites;
